import React, { useState } from 'react'
import { Link } from 'react-router-dom';

function handleSubmit(e) {
    e.preventDefault();
    console.log('Envio a registrar.');
  }

function Login(){

    const [values, setValues] =useState({
        email:'',
        password:''
    })
    return(
        <div className='d-flex justify-content-center align-items-center bg-primary vh-100'>
            <div className='bg-white p-3 rounded w-25'>
                <form action=''>
                    <div className='mb-3'>
                        <label htmlFor='email'>Email</label>
                        <input type='email' placeholder='email' className='form-control rounded-0'></input>
                    </div>
                    <div className='mb-3'>
                        <label htmlFor='password'>Password</label>
                        <input type='password' placeholder='password' className='form-control rounded-0'></input>
                    </div>
                    <button onClick={handleSubmit} className='btn btn-success w-100'>Inicio sesion</button>
                    <p>Holaaaa</p>
                    <Link to="/registrar"  className='btn btn-default border w-100 bg-light text-decoration-none '>Registrarse</Link>

                </form>
            </div>
        </div>
    )
}
export default Login;
